// OwnerDashboard.js
import React from 'react';
import LogoutButton from './reuse/Logout';

function OwnerDashboard() {
  return (
    <div>
      <h2>Owner Dashboard</h2>
      {/* Owner-specific content */}
      <LogoutButton />
    </div>
  );
}

export default OwnerDashboard;
